import React from "react";
import { Link } from "react-router-dom";
import { Button } from "react-bootstrap";
import CustomNavbar from "../Navbar/CustomNavbar";
import Footer from "../Footer/footer";
import Header from "../Header/header";
//import Accordion from "../Acordion/acordion";
//import AccordionCard from "../Acordion/accordionCard";
import "./Home.css";
import FilterBar from "../FilterBar/FilterBar";
import Navigationbar from "../Carrousel/NavigationBar/NavigationBar";
import CarrouselPage from "../Carrousel/CarrouselPage/CarrouselPage";

const Home = () => {
  return (
    <div classname="Home">
      <CustomNavbar />

      <CarrouselPage />
      <div className="content"></div>

        <h1> 
        </h1>

       <Header />
       <FilterBar />
        <Navigationbar/>
    </div>
  );
};

export default Home;
